import React from "react";

onChangeHandler = event => {
  this.setState({
    selectedFile: event.target.files[0],
    loaded: 0
  });
};
function UploadFile() {
  return <input type="file" name="file" onChange={this.onChangeHandler} />;
}

export default UploadFile;
